    (8, '5432 Redwood Drive', 3000, 3, 5, 'Plano', '2023-09-06 09:37:54.762667', 'Flexible lease duration 6-12 months. All bills (internet, cleaning, trash, water, electricity, landscaping, gas, terminator, etc.) included in rent! Property comes fully furnished or empty.This stylish place to stay is a two-story home with all bedrooms located upstairs. 3rd bedroom has standing desk with pull out couch, including memory foam mattress. All bedrooms boast high ceilings and terrific natural lighting. Outdoor space was curated for hosting. Full kitchen. Concrete floors throughout downstairs. Less than a ten-minute uber ride downtown. A bike ride away from all the east-side bars and breweries. 12 mins to the airport! Energy-efficient home. Set up a playroom, sitting area, or gaming area in the second-story loft. Open concept style for kitchen, living, and dining areas. Generously sized secondary bedrooms each feature walk-in closets for bonus storage. Patio and nice sized backyard. 2 car garage, driveway and street parking. This property is in a great location. Bar-W shopping center with grocery store, restaurants and gas station is less than 2 miles away. Fire station is close by. It is 30 mintues from downtown Austin, 43 minutes to Fort Cavazos (Carl R Darnall Medical Center/III Corps HQ/Dental Clinic door to door 33 miles), 32 minutes to Camp Mabry. There are multiple daycares within a 5 mile radius. Goddard daycare is within the community. Zoned for Liberty Hill ISD. Great school district. Middle school within walking distance. Patio and Nice sized backyard. Community Amenities include: 2 pools, open air event pavilion, hiking trails, zipline, basketball court, multiple playgrounds, nature trail fitness stations, big dipper fishing pond, and community events. ADT Security System. Morningstar community.', 'https://cdn.filestackcontent.com/Y8sGjPdmSOWIuBQigDkw', 'https://cdn.filestackcontent.com/r9tSLksrTiK76I9UGrRE', 'https://cdn.filestackcontent.com/qKP1of2S7yKqSQZw7Q2