    (9, '7890 Juniper Avenue', 900, 1, 2, 'Corpus Christi', '2023-09-06 09:37:54.762667', 'Room available in a beautiful, shared 4 bed, 2 bath Willow Run home north of downtown Austin! Oversized, arched windows let in lots of natural light, hardwood floors shine throughout the main floor, and the open floor plan is updated and comfortable. Highlights include an updated kitchen with a gas stove and dishwasher inside, plus a big patio and fenced backyard for endless outdoor entertaining possibilities outside! There''s also a large dining room and a bonus sitting area, in addition to the spacious living room. This welcoming home also features air conditioning, ceiling fans, an in-home laundry room with a full-size washer/dryer, an attached garage, off-street parking, and a Smart thermostat and doorbell.This fantastic Willow Run neighborhood is only 16 miles from downtown Austin and offers a convenient close-in location but with all the suburban perks. Live on a quiet, tree-lined street only minutes to area employers, including Apple, Domain, Dell, IBM, and La Frontera. It’s just over a mile to Mills Pond Recreation Area for trails and a fishing pier. Pick up groceries at HEB, Sprouts Farmers Market, and Target Grocery—all are within a six-mile drive. Plus, there are several popular dining nearby, including Whiskey Cake Kitchen & Bar, Arepitas, and Jack Allen’s Kitchen. About Bungalow: We are on a mission to take the hassle out of renting. When you live in a Bungalow managed property, you are getting a modern, tech-enabled, responsive landlord from Day 1. We have all your needs covered, from utility setup to flexible lease terms, an easy-to-use app for paying rent, on-staff maintenance technicians, a dedicated team of customer support experts, and even optional furnishings and monthly cleanings. Find out why thousands of renters are choosing to rent with Bungalow.', 'https://cdn.filestackcontent.com/Y8sGjPdmSOWIuBQigDkw', 'https://cdn.filestackcontent.com/r9tSLksrTiK76I