    (10, '1357 Magnolia Road', 1800, 2, 3, 'Lubbock', '2023-09-06 09:37:54.762667', '*** Fully Furnished, urban paradise close to downtown Austin with a wooded scenic view. The rental is a 2BR, 2.5BA, with all the extras included! - beds, TVs, beddings, pillows, linens, hangers, hair dryers, iron and iron board, kitchen pots, cookers, silverwares, coffee machines and so on. What you see in the picture is what we offer for this rental. ***Exceptional, creek-side rear facing deck with a luxurious Jacuzzi, offering you a great natural view to relax outdoors with great privacy. Less than a mile from the Morris Williams Golf Course and community waterpark. Close to downtown Austin.Relax in the evening in the Jacuzzi that has luxurious LED lights with all range of colors. Offering you a luxury SPA experience.Each of the two bedrooms have their own private bathroom, plus the king-sized master bedroom has access to a balcony with a view! The 2nd bedroom comes with queen bed and super comfy mattress. There''s a half-bath near the kitchen in the first floor. Two futons in the common living area sleeps 2 more guests for a total of 6.An open floor plan connects the kitchen, dining and both living areas, offering good flow and space for entertaining. A large bay window lets in lots of light. The house is fully furnished with everything you need to call it home. We provide high quality bedspreads, blankets, pillows, linens and towels. The kitchen is fully equipped with all appliances. The house is also equipped with an entertainment center.For your further comfort, especially those with allergies, we have whole home in-duct HVAC units installed which can kill up to 99% of bacteria, mold and viruses, as well as neutralize dust and pollen.This home is a modern home complete with a home automation system which controls AC temperature, lighting, and more.The driveway in front of the house can easily fit two SUVs for parking.Lease options from 3 months to 12 months are available.', 'h